// Functions
function insert_line(index) {
    const line = document.querySelector('#line-form-template').content.cloneNode(true);

    const form = line.querySelector('form');
    form.dataset.index = index;
    form.addEventListener('change', () => {
        console.log((index-(index%5))/5)
        docDefinition.content[0].columns[(index-(index%5))/5].stack[(index%5) + 1].stack[0].text = form.querySelector('.header').value;
        docDefinition.content[0].columns[(index-(index%5))/5].stack[(index%5) + 1].stack[1].text = form.querySelector('.subheader').value;
        docDefinition.content[0].columns[(index-(index%5))/5].stack[(index%5) + 1].stack[2].text = form.querySelector('.price').value;
        //render_pdf(); // Optimazation
    });

    form.querySelector('.index').textContent = 'regel ' + (index + 1);

    // TODO: Implement functionality to copy and delete.
    //form.querySelector('.copy').addEventListener('click', () => '');
    //form.querySelector('.delete').addEventListener('click', () => '');

    form_list.appendChild(line);
}

function render_pdf() {
    const pdfDocGenerator = pdfMake.createPdf(docDefinition);
    pdfDocGenerator.getDataUrl((dataUrl) => {
        document.querySelector('iframe').src = dataUrl;
    });
}

