const image_selection_form = document.querySelector('.image-selection');
image_selection_form.addEventListener('click', () => {
    let image = images.none;
    switch (image_selection_form.querySelector('input[name="image"]:checked').value) {
        case 'december':
            image = images.december;
            break;
        default:
            image = images.none;
            break;

    }
    docDefinition.content[0].columns[0].stack[0].image = image;
    docDefinition.content[0].columns[1].stack[0].image = image;

});

document.querySelector('#preview').addEventListener('click', () => render_pdf());

